  \"2013-03-15T23:49:09.027253\",\n\t\"name\": \"geothermal-resources-of-the-western-arm-of-the-black-rock-desert-northwestern-nevada-part-i-geo\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this report, prepared in
  conjunction with the U.S. Bureau of Land Management, is to provide the Bureau with
  the information necessary to determine the geothermal potential of the western arm
  of the Black Rock Desert. The information required by the Bureau includes: (1) A
  geologic map of the Black Rock area, showing lithologic units and known and inferred
  faults, (2) definition of possible geothermal anomalies from the examination of
  thermal infrared imagery, (3) delineation of the surface thermal gradient, and (4)
  delineation of the depth to bedrock beneath the study area. These objectives were
  accomplished by a multidiscipline approach of hydrological, geochemical, geophysical,
  and remote-sensing techniques. The work was done between February 1979 and May 1980.\",\n\t\"license_title\":
